import React from "react";
import Login from "../components/Login/Login.js";
import Header from "../components/Header/Header.js";
import axios from 'axios';
import { useState } from 'react';
import { Stack } from "@mui/material";
import { useNavigate, useParams } from "react-router-dom";

const MainPage = () => {

    const [data, setDataList] = useState([]);
    const [refresh, setRefresh] = useState(false);
    const { sifKviz } = useParams();
    const [kviz, setKviz] = useState('');


    React.useEffect(() => {
        const getData = async () => {
            let dataa = (
                await axios.get('http://localhost:5000/session')
            ).data;
            //setValue(data[0]);
            setDataList(dataa);
        };
        const getKviz = async () => {
            let data2 = (
                await axios.get('http://localhost:5000/quiz/' + sifKviz)
            ).data;
            //setValue(data[0]);
            setKviz(data2);
        };
        getKviz().catch((err) => console.log(err));
        getData().catch((err) => console.log(err));
    }, [refresh]);

    return(
        <div>
            <Header />
            <Stack direction='row' justifyContent='center' alignItems='center' spacing='5rem' style={{ marginBlock: '2rem' }}>
                <div className='modal' style={{
                    backgroundColor: "white", borderRadius: 7,
                    border: '6px solid rgba(255, 165, 0, 0.5)',
                    padding: '30px 30px',

                }}>
                    <div ><img src={kviz.image} alt="" style={{height: '3500px'}} /></div>
                    <Stack direction='column' justifyContent='center' alignItems='center' spacing='5rem' style={{ marginBlock: '2rem' }}>
                        
                    </Stack>
                </div>
            </Stack>
        </div>
    );
};

export default MainPage;
